import Link from 'next/link';
import { SpeechBubble } from 'react-kawaii'

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    <SpeechBubble size={20} mood="happy" color="#83D1FB"></SpeechBubble>
  </div>
);

export default Header;
